import React from "react";
import { useForm } from "react-hook-form";
import { Link } from "react-router-dom";
import { registerUser } from "../api/auth";
import "bootstrap/dist/css/bootstrap.min.css";
import "./Signup.css"; // Import custom CSS

const Signup = () => {
  const {
    register,
    handleSubmit,
    formState: { errors },
  } = useForm();

  const onSubmit = async (data) => {
    try {
      const response = await registerUser({
        email: data.email,
        username: data.username,
        password: data.password,
      });

      alert("Signup Successful! Redirecting...");
      console.log("Registration Success:", response);
      window.location.href = "/home";
    } catch (error) {
      alert(error.message || "Signup failed. Please try again.");
      console.error("Signup Error:", error);
    }
  };

  return (
    <div className="signup-container">
      {/* Left Section (Dark Background) */}
      <div className="left-section">
        <h1>Create your free account</h1>
        <p>Explore GitHub’s core features for individuals and organizations.</p>
        <p>
          <Link to="#">See what’s included ▼</Link>
        </p>
      </div>

      {/* Right Section (Signup Form) */}
      <div className="right-section">
        <div className="form-wrapper">
          <h3>Sign up to GitHub</h3>
          <form onSubmit={handleSubmit(onSubmit)}>
            {/* Email Field */}
            <div className="form-group">
              <label>Email*</label>
              <input
                type="email"
                className={`form-control ${errors.email ? "is-invalid" : ""}`}
                placeholder="Email"
                {...register("email", { required: "Email is required" })}
              />
              {errors.email && (
                <div className="invalid-feedback">{errors.email.message}</div>
              )}
            </div>

            {/* Password Field */}
            <div className="form-group">
              <label>Password*</label>
              <input
                type="password"
                className={`form-control ${errors.password ? "is-invalid" : ""}`}
                placeholder="Password"
                {...register("password", {
                  required: "Password is required",
                  minLength: {
                    value: 8,
                    message: "Password must be at least 8 characters",
                  },
                })}
              />
              {errors.password && (
                <div className="invalid-feedback">{errors.password.message}</div>
              )}
              <small className="form-text">
                Password should be at least 15 characters OR at least 8
                characters including a number and a lowercase letter.
              </small>
            </div>

            {/* Username Field */}
            <div className="form-group">
              <label>Username*</label>
              <input
                type="text"
                className={`form-control ${errors.username ? "is-invalid" : ""}`}
                placeholder="Username"
                {...register("username", {
                  required: "Username is required",
                  pattern: {
                    value: /^[a-zA-Z0-9-]+$/,
                    message: "Invalid username format",
                  },
                })}
              />
              {errors.username && (
                <div className="invalid-feedback">{errors.username.message}</div>
              )}
              <small className="form-text">
                Username may only contain alphanumeric characters or hyphens, and
                cannot begin or end with a hyphen.
              </small>
            </div>

            {/* Continue Button */}
            <button type="submit" className="btn btn-primary w-100">
              Continue →
            </button>
          </form>

          {/* Terms & Privacy */}
          <p className="terms">
            By creating an account, you agree to the{" "}
            <Link to="#">Terms of Service</Link>. See the{" "}
            <Link to="#">GitHub Privacy Statement</Link>.
          </p>

          {/* Already have an account */}
          <p className="login-link">
            Already have an account? <Link to="/login">Sign in →</Link>
          </p>
        </div>
      </div>
    </div>
  );
};

export default Signup;
